	HiOutlineViewGrid,
	HiOutlineCube,
	HiOutlineShoppingCart,
	HiOutlineUsers,
	HiOutlineDocumentText,
	HiOutlineAnnotation,
	HiOutlineQuestionMarkCircle,
	HiOutlineCog,
	HiOutlineDocument,
	HiLibrary 

} from 'react-icons/hi'

import { RiHome4Line } from "react-icons/ri";
import { PiUsersThreeBold } from "react-icons/pi";

export const DASHBOARD_SIDEBAR_LINKS = [
	{
		key: 'dashboard',
		label: 'Dashboard',
		path: '/',
		icon: <RiHome4Line />
	},
	{
		key: 'customers',
		label: 'Customers',
		path: '/customers',
		icon: <PiUsersThreeBold />
	},
	{
		key: 'categories',
		label: 'Categories',
		path: '/categories',
		icon: <HiOutlineViewGrid />
	},
	{
		key: 'orders',
		label: 'Orders',
		path: '/orders',
		icon: <HiOutlineDocument />
	},
	{
		key: 'warehouses',
		label: 'Warehouses',
		path: '/warehouses',
		icon: <HiLibrary />
	},
	// {
